DROP TABLE IF EXISTS `t_FeedBack`;
CREATE TABLE `t_FeedBack` (
  `FeedBack_ID` bigint(20) NOT NULL DEFAULT '0' COMMENT '编号',
  `FeedBack_CreateTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `FeedBack_ModifyTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `FeedBack_Status` int(2) DEFAULT '1' COMMENT '状态 【正常：1   删除：88】',
  `FeedBack_UserID` bigint(20) DEFAULT '0' COMMENT '用户编号',
  `FeedBack_Anonymity` int(2) DEFAULT '0' COMMENT '是否匿名 【不匿名：0   匿名：1】',
  `FeedBack_Content` blob COMMENT '反馈内容',
  PRIMARY KEY (`FeedBack_ID`),
  KEY `Status` (`FeedBack_Status`) USING BTREE,
  KEY `Anonymity` (`FeedBack_Anonymity`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

