DROP TABLE IF EXISTS `t_Menu`;
CREATE TABLE `t_Menu` (
  `Menu_ID` bigint(20) NOT NULL DEFAULT '0' COMMENT '编号',
  `Menu_CreateTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `Menu_ModifyTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `Menu_Status` int(2) DEFAULT '1' COMMENT '状态 【正常：1   删除：88】',
  `Menu_Name` varchar(20) DEFAULT '' COMMENT '菜单名字',
  `Menu_Memo` varchar(100) DEFAULT '' COMMENT '备注',
  `Menu_Type` int(2) DEFAULT '0' COMMENT '菜单类型【目录:0   菜单:1   操作:2】',
  `Menu_ParentID` bigint(20) DEFAULT '0' COMMENT '父编号',
  `Menu_Logo` varchar(50) DEFAULT '' COMMENT '图标地址 只允许H+里面的图标',
  `Menu_Url` varchar(100) DEFAULT '' COMMENT '地址',
  `Menu_Order` int(2) DEFAULT '0' COMMENT '排序',
  `Menu_AdminID` bigint(20) DEFAULT '0' COMMENT '操作者',
  `Menu_End` int(2) DEFAULT '1' COMMENT '是否是最低级 【不是低级 0  低级1 】',
  `Menu_UrlType` int(2) DEFAULT '0' COMMENT 'Url 类型 【后台：0  移动端：1】',
  PRIMARY KEY (`Menu_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

