-- ----------------------------
--  Table structure for `t_OnLine`
-- ----------------------------
DROP TABLE IF EXISTS `t_OnLine`;
CREATE TABLE `t_OnLine` (
  `OnLine_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '在线编号',
  `OnLine_UserID` bigint(20) DEFAULT '0' COMMENT '用户编号 或者管理员编号 ',
  `OnLine_Session` varchar(100) DEFAULT '' COMMENT '会话编号',
  `OnLine_CreateTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `OnLine_ModifyTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `OnLine_Version` int(11) DEFAULT '0' COMMENT '登录次数',
  `OnLine_Status` int(2) DEFAULT '1' COMMENT '状态信息【正常：1    删除：88】',
  `OnLine_Type` int(2) DEFAULT '0' COMMENT '登录身份类型【用户:0  管理人员：1】',
  PRIMARY KEY (`OnLine_ID`),
  KEY `userid` (`OnLine_UserID`) USING BTREE,
  KEY `status` (`OnLine_Status`) USING BTREE,
  KEY `type` (`OnLine_Type`) USING BTREE,
  KEY `session` (`OnLine_Session`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=999111486481764353 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

