DROP TABLE IF EXISTS `t_Operation`;
CREATE TABLE `t_Operation` (
  `Operation_ID` bigint(20) NOT NULL DEFAULT '0' COMMENT '编号',
  `Operation_Message` varchar(500) DEFAULT NULL COMMENT '操作信息',
  `Operation_CreateTime` datetime DEFAULT NULL COMMENT '创建时间',
