  `Operation_Type` varchar(255) DEFAULT '1' COMMENT '类型 登录情况不作为判断【用户:0   管理员：1】',
  PRIMARY KEY (`Operation_ID`),
  KEY `UserID` (`Operation_UserID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

