-- ----------------------------
--  Table structure for `t_Power`
-- ----------------------------
DROP TABLE IF EXISTS `t_Power`;
CREATE TABLE `t_Power` (
  `Power_ID` bigint(20) NOT NULL DEFAULT '0' COMMENT '编号',
  `Power_CreateTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `Power_ModifyTime` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `Power_Status` int(2) DEFAULT '1' COMMENT '状态 【正常：1   删除：88】',
  `Power_ParentID` bigint(20) DEFAULT '0' COMMENT '父编号',
  `Power_Order` int(2) DEFAULT '0' COMMENT '排序',
  `Power_AdminID` bigint(20) DEFAULT '0' COMMENT '操作者',
  `Power_End` int(2) DEFAULT '1' COMMENT '是否是最低级 【不是低级 0  低级1 】',
  `Power_MenuID` bigint(20) DEFAULT '0' COMMENT '菜单的编号',
  `Power_RoleID` bigint(20) DEFAULT '0' COMMENT '角色的编号',
  `Power_Type` int(2) DEFAULT '0' COMMENT '菜单类型',
  PRIMARY KEY (`Power_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

