-- ----------------------------
--  Table structure for `t_Region`
-- ----------------------------
DROP TABLE IF EXISTS `t_Region`;
CREATE TABLE `t_Region` (
  `Region_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `Region_Code` varchar(100) NOT NULL DEFAULT '' COMMENT 'code',
  `Region_Name` varchar(100) NOT NULL DEFAULT '' COMMENT '名字',
  `Region_ParentID` bigint(20) NOT NULL DEFAULT '0' COMMENT '父ID',
  `Region_Level` int(2) NOT NULL DEFAULT '0' COMMENT '等级 【国家：0  省：1   市：2   区：3   学校：4  】',
  `Region_Order` int(5) NOT NULL DEFAULT '0' COMMENT '排序',
  `Region_NameEn` varchar(100) NOT NULL DEFAULT '' COMMENT '英文名',
  `Region_ShortNameEn` varchar(100) NOT NULL DEFAULT '' COMMENT '短英文名',
  `Region_ProvinceID` bigint(20) DEFAULT '0' COMMENT '省份编号',
  `Region_ProvinceName` varchar(100) DEFAULT '' COMMENT '省份名字',
  `Region_CityID` bigint(20) DEFAULT '0' COMMENT '城市编号',
  `Region_CityName` varchar(100) DEFAULT '' COMMENT '城市名字',
  `Region_AreaID` bigint(20) DEFAULT '0' COMMENT '区域编号',
  `Region_AreaName` varchar(255) DEFAULT '' COMMENT '区域名字',
  `Region_Status` int(2) DEFAULT '1' COMMENT '状态 【正常：1  删除：88】',
  PRIMARY KEY (`Region_ID`),
  KEY `PARENT_ID_Index` (`Region_ParentID`),
  KEY `ProvinceID` (`Region_ProvinceID`) USING BTREE,
  KEY `CityID` (`Region_CityID`) USING BTREE,
  KEY `AreaID` (`Region_AreaID`) USING BTREE,
  FULLTEXT KEY `REGION_NAME_FullText` (`Region_Name`)
) ENGINE=InnoDB AUTO_INCREMENT=890416820916326401 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

