  `User_Status` int(2) DEFAULT '1' COMMENT '状态 【正常：1   删除：88】',
  `User_LoginName` varchar(50) DEFAULT '' COMMENT '登录名',
  `User_PassWord` varchar(50) DEFAULT '' COMMENT '登录密码',
  `User_HeadImg` varchar(200) DEFAULT '' COMMENT '头像',
  `User_Name` blob COMMENT '用户名',
  `User_NikeName` blob COMMENT '微信名字【不是微信不需要】',
