  KEY `loginname` (`User_LoginName`) USING BTREE,
  KEY `password` (`User_PassWord`) USING BTREE,
  KEY `status` (`User_Status`) USING BTREE,
  KEY `phone` (`User_Phone`) USING BTREE,
  KEY `Unionid` (`User_UnionID`) USING BTREE,
  KEY `openid` (`User_OpenID`) USING BTREE,
  KEY `ProvinceID` (`User_ProvinceID`) USING BTREE,
  KEY `AreaID` (`User_AreaID`) USING BTREE,
  KEY `CityID` (`User_CityID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

